import React, { useState, useEffect } from 'react';
import { apiService } from '../services/api';
import CourseCard from '../components/CourseCard';

const Courses = () => {
  const [courses, setCourses] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [filter, setFilter] = useState('all');

  useEffect(() => {
    loadCourses();
  }, []);

  const loadCourses = async () => {
    try {
      setLoading(true);
      const data = await apiService.getCourses();
      setCourses(data);
      setError('');
    } catch (err) {
      setError('Failed to load courses. Please try again later.');
      console.error('Error loading courses:', err);
    } finally {
      setLoading(false);
    }
  };

  const filteredCourses = filter === 'all' 
    ? courses 
    : courses.filter(course => course.category.toLowerCase().includes(filter.toLowerCase()));

  const categories = ['all', 'AI/ML', 'Generative AI', 'Deep Learning', 'NLP', 'Computer Vision'];

  return (
    <div className="courses-page">
      <div className="courses-hero">
        <div className="container">
          <h1>Explore Our Courses</h1>
          <p>Master the future of technology with our comprehensive AI curriculum</p>
        </div>
      </div>

      <div className="container">
        {/* Filter Section */}
        <div className="filter-section" style={{ margin: '2rem 0', textAlign: 'center' }}>
          <div className="filter-buttons">
            {categories.map(category => (
              <button
                key={category}
                className={`filter-btn ${filter === category ? 'active' : ''}`}
                onClick={() => setFilter(category)}
              >
                {category === 'all' ? 'All Courses' : category}
              </button>
            ))}
          </div>
        </div>

        {/* Courses Grid */}
        {loading ? (
          <div className="loading">Loading courses from PostgreSQL...</div>
        ) : error ? (
          <div className="error">
            <h2>Error Loading Courses</h2>
            <p>{error}</p>
            <button onClick={loadCourses} className="btn btn-primary">
              Try Again
            </button>
          </div>
        ) : (
          <>
            <div className="courses-header">
              <h2>
                {filter === 'all' ? 'All Courses' : filter} 
                <span style={{ color: 'var(--text-light)', fontSize: '1rem' }}>
                  {' '}({filteredCourses.length})
                </span>
              </h2>
              <button onClick={loadCourses} className="btn btn-secondary">
                Refresh Courses
              </button>
            </div>

            <div className="courses-grid">
              {filteredCourses.map(course => (
                <CourseCard key={course.id} course={course} />
              ))}
            </div>

            {filteredCourses.length === 0 && (
              <div className="no-courses">
                <h3>No courses found</h3>
                <p>Try selecting a different category</p>
              </div>
            )}
          </>
        )}
      </div>

      <style jsx>{`
        .filter-buttons {
          display: flex;
          gap: 1rem;
          justify-content: center;
          flex-wrap: wrap;
          margin-bottom: 2rem;
        }

        .filter-btn {
          padding: 0.75rem 1.5rem;
          border: 2px solid var(--accent-blue);
          background: transparent;
          color: var(--accent-blue);
          border-radius: 25px;
          cursor: pointer;
          font-weight: 600;
          transition: all 0.3s ease;
        }

        .filter-btn:hover,
        .filter-btn.active {
          background: var(--accent-blue);
          color: var(--white);
        }

        .courses-header {
          display: flex;
          justify-content: space-between;
          align-items: center;
          margin: 3rem 0 2rem 0;
        }

        @media (max-width: 768px) {
          .courses-header {
            flex-direction: column;
            gap: 1rem;
            text-align: center;
          }
        }
      `}</style>
    </div>
  );
};

export default Courses;
